void Sakura::Cvar::Add(const char* name, void* data)
{
	int index = entries.size();
	Entry tmp = { data };
	entries.push_back(tmp);
	names.add(name, index);
}

void Sakura::Cvar::New(const char* cvarName, float &cvar, float defaultValue)
{
	Add(cvarName, &cvar);
	cvar = defaultValue;
}

