void SaveCvar()
{
	std::ofstream ofs(Sakura::File::GetSakuraDir(Sakura::Config::GetCurrent().c_str()).c_str());
	Sakura::Config::Save(ofs);
	ofs.close();
}

void LoadCvar()
{
	cvar.init();
	if (Sakura::File::Exists(Sakura::File::GetSakuraDir(Sakura::Config::GetCurrent().c_str()).c_str()))
		Sakura::Config::Load();
}